import React, { Component } from 'react';
import { Line } from 'react-chartjs-2';

class Charts extends Component {
    constructor(props){
        super(props);

        this.state={
            data:{
                labels:["1","2","3",4]
            }
        }
    }
	render() {
		return (
			<div>
				<h3>Latest Hits</h3>
				<Line options={{ responsive: true }} data={this.state.data} />
			</div>  
		);
	}
}

export default Charts;
